import React, { Component } from 'react';
import Paper from '@material-ui/core/Paper';
import crown from '../imgs/crown.png';
import Typography from '@material-ui/core/Typography';
import Grid from '@material-ui/core/Grid';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';

const styles = {
    paper : {
        margin:5,
        padding:10
    },
    img : {
        width: 50
    }
}

class Achievments extends Component {
    render() {
        return (
            <div>
                <Paper style={styles.paper}>
                    <Grid container style={{margin: "auto"}}>
                        <Grid item md={2}>
                            <img src={crown} alt="crown" style={styles.img}/>
                        </Grid>
                        <Grid item md={10}>
                            <Typography variant="h4">Accomplished</Typography>
                        </Grid>
                        <hr></hr>
                    </Grid>
                </Paper>
            </div>
        )
    }
}

Achievments.propTypes = {
    user: PropTypes.object.isRequired
  };
  
  
  const mapStateToProps = (state) => ({
    user: state.user
  });
  
  const mapActionsToProps = { };
  
  export default connect(mapStateToProps,mapActionsToProps)(Achievments);
